import React, { useState, useEffect } from 'react';
import api from '../Services/api';
import Pauta from '../Components/pauta';

const Home = () => {
  const [pautas, setPautas] = useState([]);

  useEffect(() => {
    api.get('/')
      .then(response => {
        console.log("Dados recebidos:", response.data); // ðŸ‘€ Verifique no console
        setPautas(response.data);
      })
      .catch(error => console.error("Erro ao buscar pautas", error));
  }, []);

  return (
    <div>
      <h1>Pautas</h1>
      {pautas.length > 0 ? (
        pautas.map(pauta => <Pauta key={pauta._id} titulo={pauta.titulo} votos={pauta.votos} />)
      ) : (
        <p>Nenhuma pauta encontrada.</p>
      )}
    </div>
  );
};

export default Home;
